import { Component } from '@angular/core';

@Component({
  selector: 'app-not-found',
  templateUrl: './notFound.component.html',
  styleUrls: ['./notFound.component.css']
})
export class NotFoundComponent {

}
<div class="mainBox">
    <div class="number"></div>
        <p>404</p>
    <div class="notFound"></div>
